import React from 'react'
import Breadcrum from '../comps/Breadcrum'
import Cat from '../comps/Cat'
function Category({name}) {

  return (
    <>
    <Breadcrum name={name}/>
    <Cat catName={name}/>
    </>
  )
}

export default Category
